import React from 'react'
import { connect } from 'react-redux';
import { keycloakAuth, fetchSpaces } from '../../redux';

function createSpace({ spaceData, authData, fetchSpaces, keycloakAuth }) {
  return (
    <form onSubmit={this.handleSubmit}>
      <label>
        Name :
        <input type="text" name= "name" />
      </label>
      <label>
        Description :
        <input type="text" name= "description" />
      </label>
      <input type="submit" value="Add Space" />
    </form>
  )
}

const mapStateToProps = state => {
    return {
        spaceData: state.space,
        authData: state.auth
    }
}

const mapDispatchToProps = dispatch => {
    return {
        fetchSpaces: (token) => dispatch(fetchSpaces(token)),
        keycloakAuth: () => dispatch(keycloakAuth())
    }
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(createSpace)
